      "text": "Wer hier ober auf dem Land noch neuen Traeber, oder Brandwein, Ohmenwein zu verkaufen hat, kann im Berichthaus einen Kaeufer dazu vernehmen, wie auch zu einem mittelmaessigen Sponten, so ebenfaels begehrt wird, beyde ohne Entgeldt im Berichthaus zu erfragen."
    },
