    },
    {
      "date": null,
      "tags_section": "Es wird zu kaufen begehrt",
      "ntokens": 34,
      "text": "Man verlangt einen noch guten Racheld-Ofen mittelmaessiger Groesse mit oder ohne Fuss, der Liebhaber ist im Berichtshaus zu erfragen; leihet aber keinen Verzug."
