      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 40,
      "text": "Ein Losament mit einem schoenen Laden und Laden-Stueblein nebst einem grossen Sommershaus, Stuben, Kuechl, 2 grosse Kammern, einem bequemen Keller, Holzplatz, ein beschlossenes Faesschen Bauchhaus, auf der Eisengaess, im Besrichtshaus zu erfragen."
