    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 40,
      "text": "Ein Losament fuer 2 Personen in der Weissgaess, bestehend aus einem Stueblein und Mietskochen, Platz zum Hausrath zu stellen, auf einem Boden, wie auch Platz zum Holz, Brunnnen un Haus, a 150 fl. find jahrs, kann gleich bezogen werden, im Berichthaus zu erfragen."
