      "text": "Ein schoenes Losament ebenes Fuesses auf einem neuen Boden von 3 Stuben, einem grossen Saal, Kammern, Kuechl, Keller, Platz zum Hof, Zutritt zum Bauchhaus, und, so beliebig, einem Garten in der Nebenhaeuser Vorstadt, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
