      "text": "Bis den 1sten diess wird eine saeubere Huendin begehrt, um etliche junge Hunde zu auserlesen, gegen einer Erfaentlichkeit; zwei sich anzu melden, ist im Berichthaus ohne Entgeldt zu vernehmen."
    },
    {
      "date": null,
